import React, { Component } from "react";
import Coverflow from "react-coverflow";
import { StyleRoot } from "radium";
import comedy from "../images/comedy.jpg";

export class Carousel3d extends Component {
  render() {
    return (
      <StyleRoot>
        <Coverflow
          displayQuantityOfSide={2}
          navigation
          infiniteScroll
          enableHeading
          media={{
            "@media (max-width: 900px)": {
              width: "600px",
              height: "300px"
            },
            "@media (min-width: 900px)": {
              width: "960px",
              height: "600px"
            }
          }}
        >
          <img src="images/album-1.png" alt="Album one" />
          <img src="images/album-2.png" alt="Album two" />
          <img src="images/album-3.png" alt="Album three" />
          <img src="images/album-4.png" alt="Album four" />
        </Coverflow>
      </StyleRoot>
    );
  }
}

export default Carousel3d;
